import { Box, Table, TableHead, Typography, TableCell, TableRow, TableBody } from '@mui/material';
import { useParams } from 'react-router-dom';
import { Patient } from '../types';
import HealthRatingBar from './HealthRatingBar';

interface Props {
    patients: Patient[]
}

const PatientPage = (patientsArray: Props) => {
    const id = useParams().id;

    console.log(patientsArray.patients)
    
    const patient = patientsArray.patients.find(p => p.id === id);

    if (!patient) {
        return(
            <div className='App'>
                Invalid patient
            </div>
        )
    }
    
    return(
        <div className='App'>
            <Box>
                <Typography align="center" variant="h6">
                {patient.name}
                </Typography>
            </Box>
            <Table style={{ marginBottom: "1em" }}>
                <TableHead>
                <TableRow>
                    <TableCell>Name</TableCell>
                    <TableCell>Gender</TableCell>
                    <TableCell>Occupation</TableCell>
                    <TableCell>Health Rating</TableCell>
                </TableRow>
                </TableHead>
                <TableBody>
                    <TableRow>
                    <TableCell></TableCell>
                    <TableCell></TableCell>
                    <TableCell></TableCell>
                    <TableCell>
                        <HealthRatingBar showText={false} rating={1} />
                    </TableCell>
                    </TableRow>
                </TableBody>
            </Table>
        </div>
    );
};

export default PatientPage;
